  <script>
  
  import Modal from "../Modal.vue";
  import ConfirmButton from "../../Buttons/FilledButton.vue";
  import CancelButton from "../../Buttons/OutlineButton.vue";
  import DeleteModal from "../../Modal/DeleteModal.vue";



  export default {
    name: 'Confirmation',
    data() {
      return {
        isDeleted: false
      }
    },
    props: {
      text: String
    },
    components: {
      Modal,
      ConfirmButton,
      CancelButton,
      DeleteModal
    },
    methods:{
       closeModal(){ 
        this.isDeleted = false;
        this.$emit('close');
      },
       deleted(){
         this.isDeleted = true;
       }
    },
  };
  </script>
  
